window.bookSummaryJSON = "<p><b>Hunting for allies. A rescue mission that goes against the natural order. Time to delve deep.</b><br> &nbsp;</p> <p>Zeke and his friends have a final few obstacles standing in their way before they can try and find a way into the Hells. Everything to this point has been an effort to rescue their buddy, Balmur. One obstacle happens to be a mythical beast that might sooner eat than help them, but no big deal...right? Beyond that, all the group needs to do is find the hidden city of the High Elves and convince them to join their cause.<br> &nbsp;</p> <p>Searching and survival: If only it were that easy. Now, there is active opposition to their goals of saving not only this world from warâ€™s influence but Earth as well.<br> &nbsp;</p> <p>Will a hungry beast be picking its teeth with their bones? Even if they survive long enough to search for Balmur, the best case scenario is the team diving into the Hells.</p>"; 
